   "source": [
    "## Kurtosis\n",
    "\n",
    "Kurtosis - explains the sharpness of the peak in the data distribution.\n",
    "\n",
    "Types of Kurtosis:\n",
    "- Mesokurtic: Normal Distribution (kurtosis = 3)\n",
    "- Leptokurtic: Higher peak and fatter tails (kurtosis > 3)\n",
    "- Platykurtic: Lower peak and thinner tails (kurtosis < 3)\n",
    "\n",
    "Example: For a dataset that has extremely high and low values, it might have a high kurtosis, indicating a leptokurtic distribution."
   ]
