    "### Probability Density Function (PDF)\n",
    "\n",
    "The Probability Density Function (PDF) describes the likelihood of a continuous random variable taking on a particular value. It provides the density of the probability rather than the probability itself.\n",
    "\n",
    "### Cumulative Distribution function (CDF)\n",
    "The Cumulative Distribution Function (CDF) represents the probability that a random variable  takes on a value less than or equal to x.\"\n",
    "\n",
    "### Kernel Density Estimation (KDE)\n",
