    "library(ggplot2)\n",
    "\n",
    "set.seed(123)\n",
    "data <-rnorm(1000, mean = 0, sd =1)\n",
    "\n",
    "kde <- density(data)\n",
    "kde_df <- data.frame(x = kde$x, y = kde$y)\n",
    "\n",
    "ggplot(kde_df, aes(x = x, y = y)) +\n",
    "  geom_line() +\n",
    "  labs(title = \"Kernel Density Estimation\",\n",
    "       x = \"Value\",\n",
    "       y = \"Density\") +\n",
    "  theme_minimal()"
   ]
